STRUCTURE KNOTVECTORS:
  PATCHES:
    - KNOT_VECTORS:
        - DEGREE: 2
          TYPE: Interpolated
          KNOTS:
            - 0.0
            - 0.0
            - 0.0
            - 0.3333333333333333
            - 0.6666666666666666
            - 1.0
            - 1.0
            - 1.0
        - DEGREE: 2
          TYPE: Interpolated
          KNOTS:
            - 0.0
            - 0.0
            - 0.0
            - 0.3333333333333333
            - 0.6666666666666666
            - 1.0
            - 1.0
            - 1.0
        - DEGREE: 2
          TYPE: Interpolated
          KNOTS:
            - 0.0
            - 0.0
            - 0.0
            - 0.5
            - 1.0
            - 1.0
            - 1.0
      ID: 1
    - KNOT_VECTORS:
        - DEGREE: 2
          TYPE: Interpolated
          KNOTS:
            - 0.0
            - 0.0
            - 0.0
            - 0.5
            - 1.0
            - 1.0
            - 1.0
        - DEGREE: 2
          TYPE: Interpolated
          KNOTS:
            - 0.0
            - 0.0
            - 0.0
            - 0.25
            - 0.5
            - 0.75
            - 1.0
            - 1.0
            - 1.0
        - DEGREE: 2
          TYPE: Interpolated
          KNOTS:
            - 0.0
            - 0.0
            - 0.0
            - 0.5
            - 1.0
            - 1.0
            - 1.0
      ID: 2
